import React from "react";
import "./ControlPins.css";

class ReadValue extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      readValuePD3: "0",
      readValuePD2: "1",
    };
  }
  render() {
    return (
      <div>
        <ul className="left-read-value-list">
          <li>
            <input
              size="1"
              type="text"
              className="read-box"
              value={this.state.readValuePD2}
            />
          </li>
          <li>
            <input
              size="1"
              type="text"
              className="read-box"
              value={this.state.readValuePD3}
            />
          </li>
        </ul>
      </div>
    );
  }
}
export default ReadValue;
